  \"2015-05-06T21:24:19.089659\",\n\t\"name\": \"acoustic-igniter-project-12ece\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"An acoustic igniter eliminates the need
  to use electrical energy to drive spark systems to initiate combustion in liquid-propellant
  rockets. It does not involve the use of catalysts (which have a limited life), it
  does not exhibit typical wear and tear as seen in spark and catalytic igniters,
  and it is simple in design with no moving parts. Orion's proposed Acoustic Igniter
  is expected to offer a long-life, highly reliable ignition system that does not
  require high-voltage electrical connections. It is less complex to operate and simpler
  than a traditional ignition system. Orion's primary technical objective is to produce
  an acoustic igniter design that will ignite combustion of common liquid rocket fuel
  and oxidizer combinations such as gaseous oxygen and kerosene, and oxygen/methane.
  During Phase 1, we analyzed the operational issues that inhibit acoustic igniter
  performance. Based on these results, Orion will built a prototype unit, tested it,
  and evaluated its performance. This work established a basis for the follow-on Phase
  2 effort to refine the design and upgrade the technology level of the acoustic igniter.
